&lt;br /&gt;
COMPLETE WEEKEND RESULTS AT TOUROFELKGROVE.COM&lt;br /&gt;
&lt;br /&gt;
ELK GROVE VILLAGE, IL – August 1, 2010— Australian Jonathan Cantwell beat out nearly100  professional cyclists to be the $18,000 overall winner of the 3-stage men's pro race at the fifth annual Alexian Brothers &amp;quot;Tour of Elk Grove&amp;quot; held Friday-Sunday, July 30-August 1, in the Chicago suburb of Elk Grove Village, Ill. &lt;br /&gt;
&lt;br /&gt;
The 3-stage men's pro race featured $118,000 in total prize money making it the largest prize purse for a 3-day, 3-stage men's pro cycling race in North America. &lt;br /&gt;
&lt;br /&gt;
Cantwell competed as a member of team Fly V Australia.  &lt;br /&gt;
&lt;br /&gt;
Placing second overall in the race, and winning $9,000, was Canadian David Veilleux, a member of the team Kelly Benefit Strategies. (Veilleux was Tour of Elk Grove's overall winner in 2008.) &lt;br /&gt;
&lt;br /&gt;
Placing third, and winning $4,500, was Australian Karl Menzies, a member Team United HealthCare presented by Maxxis.&lt;br /&gt;
&lt;br /&gt;
Individual Pro Men's Stage Winners&lt;br /&gt;
•New Zealand's Peter Latham (Bissell Pro Cycling) placed first at Friday's Stage 1 Time Trial (4.5 mile).&lt;br /&gt;
•Cantwell  placed first at Saturday's Stage 2 Road Race(150K) as well as first place  in Sunday's Stage 3 Criterium (110K).&lt;br /&gt;
&lt;br /&gt;
Bissell Pro Cycling team was this year's overall team winner.&lt;br /&gt;
&lt;br /&gt;
Tour of Elk Grove featured $150,000 in total cash prize money for the 15 professional and amateur races held during the weekend. (The majority of races were &amp;quot;criterium&amp;quot;--a bike race held in a closed loop.)  &lt;br /&gt;
&lt;br /&gt;
Over the weekend more than 25,000 spectators viewed over 1,000 cyclists compete at 15 pro/am races. &lt;br /&gt;
&lt;br /&gt;
Tour of Elk Grove is presented by Alexian Brothers Medical Center, an acclaimed health care facility in Elk Grove Village.&lt;br /&gt;
